define([],function(){var module={};module.helixCancelClick=function(){var xmlDoc=null;if(typeof window.ActiveXObject!="undefined"){xmlDoc=new ActiveXObject("Microsoft.XMLHTTP")}else{xmlDoc=new XMLHttpRequest;var params="resource_link_id="+module.resID+"&user_id="+module.userID;xmlDoc.open("POST",module.statusURL,false);xmlDoc.setRequestHeader("Content-type","application/x-www-form-urlencoded");xmlDoc.send(params)}};module.bind=function(){var cbtn=document.getElementById("id_cancel");if(cbtn!=null){cbtn.addEventListener("click",module.helixCancelClick)}};module.init=function(resID,userID,statusURL){module.resID=resID;module.userID=userID;module.statusURL=statusURL;module.bind()};return module});